INSERT INTO `edu_course_description` VALUES ('1104870479077879809','<p>11</p>','2019-03-11 06:23:44','2019-03-11 06:23:44'),('1381882461750325249','<p>深度神经网络<strong>很牛</strong></p>','2021-04-13 16:10:28','2021-04-13 16:10:28'),('1381936377754095618','','2021-04-13 19:44:42','2021-04-13 19:48:05'),('1381951561377837057','<p>11111</p>','2021-04-13 20:45:02','2021-04-13 21:59:59'),('1382573535040917505','<p>JavaWeb的基础课程</p>','2021-04-15 13:56:32','2021-04-15 13:56:32'),('1385808251953627138','<div class=\"para\">指相对于初等数学而言，数学的对象及方法较为繁杂的一部分。</div>\n<div class=\"para\">广义地说，<a href=\"https://baike.baidu.com/item/%E5%88%9D%E7%AD%89%E6%95%B0%E5%AD%A6/73082\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"73082\">初等数学</a>之外的数学都是高等数学，也有将中学较深入的<a href=\"https://baike.baidu.com/item/%E4%BB%A3%E6%95%B0/1434787\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"1434787\">代数</a>、<a href=\"https://baike.baidu.com/item/%E5%87%A0%E4%BD%95/303227\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"303227\">几何</a>以及简单的<a href=\"https://baike.baidu.com/item/%E9%9B%86%E5%90%88%E8%AE%BA/494533\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"494533\">集合论</a>初步、<a href=\"https://baike.baidu.com/item/%E9%80%BB%E8%BE%91/543\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"543\">逻辑</a>初步称为<a href=\"https://baike.baidu.com/item/%E4%B8%AD%E7%AD%89%E6%95%B0%E5%AD%A6/6480527\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"6480527\">中等数学</a>的，将其作为中小学阶段的初等数学与大学阶段的高等数学的过渡。</div>\n<div class=\"para\">通常认为，高等数学是由<a href=\"https://baike.baidu.com/item/%E5%BE%AE%E7%A7%AF%E5%88%86%E5%AD%A6/710552\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"710552\">微积分学</a>，较深入的<a href=\"https://baike.baidu.com/item/%E4%BB%A3%E6%95%B0\" target=\"_blank\" rel=\"noopener\">代数</a>学、<a href=\"https://baike.baidu.com/item/%E5%87%A0%E4%BD%95%E5%AD%A6/342546\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"342546\">几何学</a>以及它们之间的交叉内容所形成的一门基础学科。</div>\n<div class=\"para\">主要内容包括：<a href=\"https://baike.baidu.com/item/%E6%95%B0%E5%88%97/731531\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"731531\">数列</a>、<a href=\"https://baike.baidu.com/item/%E6%9E%81%E9%99%90/3564509\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"3564509\">极限</a>、<a href=\"https://baike.baidu.com/item/%E5%BE%AE%E7%A7%AF%E5%88%86/6065\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"6065\">微积分</a>、<a href=\"https://baike.baidu.com/item/%E7%A9%BA%E9%97%B4%E8%A7%A3%E6%9E%90%E5%87%A0%E4%BD%95\" target=\"_blank\" rel=\"noopener\">空间解析几何</a>与<a href=\"https://baike.baidu.com/item/%E7%BA%BF%E6%80%A7%E4%BB%A3%E6%95%B0/800\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"800\">线性代数</a>、<a href=\"https://baike.baidu.com/item/%E7%BA%A7%E6%95%B0/2381414\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"2381414\">级数</a>、<a href=\"https://baike.baidu.com/item/%E5%B8%B8%E5%BE%AE%E5%88%86%E6%96%B9%E7%A8%8B/818194\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"818194\">常微分方程</a>。</div>\n<div class=\"para\"><a href=\"https://baike.baidu.com/item/%E5%B7%A5%E7%A7%91/9824985\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"9824985\">工科</a>、<a href=\"https://baike.baidu.com/item/%E7%90%86%E7%A7%91/6532679\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"6532679\">理科</a>、<a href=\"https://baike.baidu.com/item/%E8%B4%A2%E7%BB%8F/2365\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"2365\">财经</a>类研究生考试的基础科目。</div>','2021-04-24 12:10:09','2021-04-27 10:25:47'),('1385836620766265345','<p>编译原理是<a href=\"https://baike.baidu.com/item/%E8%AE%A1%E7%AE%97%E6%9C%BA%E4%B8%93%E4%B8%9A/10586245\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"10586245\">计算机专业</a>的一门重要<a href=\"https://baike.baidu.com/item/%E4%B8%93%E4%B8%9A%E8%AF%BE/9734511\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"9734511\">专业课</a>，旨在介绍<a href=\"https://baike.baidu.com/item/%E7%BC%96%E8%AF%91%E7%A8%8B%E5%BA%8F/8290180\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"8290180\">编译程序</a>构造的一般原理和基本方法。内容包括语言和文法、词法分析、语法分析、<a href=\"https://baike.baidu.com/item/%E8%AF%AD%E6%B3%95%E5%88%B6%E5%AF%BC%E7%BF%BB%E8%AF%91/2665709\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"2665709\">语法制导翻译</a>、中间代码生成、<a href=\"https://baike.baidu.com/item/%E5%AD%98%E5%82%A8%E7%AE%A1%E7%90%86/9827115\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"9827115\">存储管理</a>、代码优化和目标代码生成。 编译原理是计算机专业设置的一门重要的专业课程。编译原理课程是计算机相关专业学生的<a href=\"https://baike.baidu.com/item/%E5%BF%85%E4%BF%AE%E8%AF%BE%E7%A8%8B/1257453\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"1257453\">必修课程</a>和高等学校培养计算机专业人才的基础及核心课程，同时也是计算机专业课程中最难及最挑战学习能力的课程之一。编译原理课程内容主要是原理性质，高度抽象<sup class=\"sup--normal\" data-sup=\"1\" data-ctrmap=\":1,\">&nbsp;[1]</sup><a class=\"sup-anchor\" name=\"ref_[1]_5127170\"></a>。</p>','2021-04-24 14:02:53','2021-04-30 19:12:32'),('1385837330912264194','<div class=\"lemma-summary\">\n<div class=\"para\">量子力学（Quantum Mechanics），为物理学理论，是研究物质世界微观粒子运动规律的物理学分支，主要研究原子、分子、凝聚态物质，以及原子核和基本粒子的结构、性质的基础理论。它与相对论一起构成现代物理学的理论基础。量子力学不仅是现代物理学的基础理论之一，而且在<a href=\"https://baike.baidu.com/item/%E5%8C%96%E5%AD%A6/127240\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"127240\">化学</a>等学科和许多近代技术中得到广泛应用。</div>\n<div class=\"para\">19世纪末，人们发现旧有的经典理论无法解释微观系统，于是经由物理学家的努力，在20世纪初创立量子力学，解释了这些现象。量子力学从根本上改变人类对物质结构及其相互作用的理解。除了广义相对论描写的引力以外，迄今所有基本相互作用均可以在量子力学的框架内描述（量子场论）。</div>\n</div>\n<div class=\"lemmaWgt-promotion-leadPVBtn\">&nbsp;</div>\n<div class=\"configModuleBanner\">&nbsp;</div>\n<div class=\"basic-info cmn-clearfix\">&nbsp;</div>','2021-04-24 14:05:42','2021-04-24 14:05:42'),('1385931301672017922','<div class=\"para\">机器学习是一门多领域交叉学科，涉及概率论、统计学、<a href=\"https://baike.baidu.com/item/%E9%80%BC%E8%BF%91%E8%AE%BA/967006\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"967006\">逼近论</a>、<a href=\"https://baike.baidu.com/item/%E5%87%B8%E5%88%86%E6%9E%90\" target=\"_blank\" rel=\"noopener\">凸分析</a>、<a href=\"https://baike.baidu.com/item/%E7%AE%97%E6%B3%95%E5%A4%8D%E6%9D%82%E5%BA%A6\" target=\"_blank\" rel=\"noopener\">算法复杂度</a>理论等多门学科。专门研究计算机怎样模拟或实现人类的<a href=\"https://baike.baidu.com/item/%E5%AD%A6%E4%B9%A0%E8%A1%8C%E4%B8%BA/5482132\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"5482132\">学习行为</a>，以获取新的知识或技能，重新组织已有的知识结构使之不断改善自身的性能。</div>\n<div class=\"para\">它是<a href=\"https://baike.baidu.com/item/%E4%BA%BA%E5%B7%A5%E6%99%BA%E8%83%BD/9180\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"9180\">人工智能</a>核心，是使计算机具有智能的根本途径。</div>','2021-04-24 20:19:06','2021-04-24 20:19:06'),('15','','2019-03-13 06:03:33','2021-04-16 20:16:30'),('18','<p>本套Java视频完全针对零基础学员，课堂实录，自发布以来，好评如潮！Java视频中注重与学生互动，讲授幽默诙谐、细致入微，覆盖Java基础所有核心知识点，同类Java视频中也是代码量大、案例多、实战性强的。同时，本Java视频教程注重技术原理剖析，深入JDK源码，辅以代码实战贯穿始终，用实践驱动理论，并辅以必要的代码练习。</p>\n<p>------------------------------------</p>\n<p>视频特点：</p>\n<p>通过学习本Java视频教程，大家能够真正将Java基础知识学以致用、活学活用，构架Java编程思想，牢牢掌握\"源码级\"的Javase核心技术，并为后续JavaWeb等技术的学习奠定扎实基础。<br /><br />1.通俗易懂，细致入微：每个知识点高屋建瓴，深入浅出，简洁明了的说明问题<br />2.具实战性：全程真正代码实战，涵盖上百个企业应用案例及练习<br />3.深入：源码分析，更有 Java 反射、动态代理的实际应用等<br />4.登录尚硅谷官网，技术讲师免费在线答疑</p>','2019-03-06 18:06:36','2021-04-16 20:16:12');
