INSERT INTO `edu_teacher` VALUES ('1','王刚','近年主持国家自然科学基金（6项）、江苏省重大科技成果转化项目（5项）、江苏省产学研前瞻性联合研究项目（3项）、省工业科技支撑、省高技术、省自然科学基金等省部级及其企业的主要科研项目40多个，多个项目在企业成功转化，产生了较好的经济、社会和环境效益。积极开展产学研科技合作，并与省内16家企业建立了江苏省研究生工作站，其中6家为江苏省优秀研究生工作站','高级',2,'https://guli-file-190513.oss-cn-beijing.aliyuncs.com/avatar/default.jpg',0,0,'2019-10-30 14:18:46','2021-04-23 20:23:35'),('1189389726308478977','李明','高占春，1967年出生，北京邮电大学计算机学院计算机网络研究中心教授、硕士生导师，主要从事计算机网络的科研和教学工作。作为项目主研人参加的国家和省部级项目有：“八五”攻关项目《军用数据网传真入网设备》、“九五”攻关项目《军用数据网后处理设备》和《军用数据网传真入网分系统》，ATN路由器等。','北京邮电大学计算机学院教授',2,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210423/47b5912b-c96e-41cd-ad0d-7a102538a5dbfile.png',1,0,'2019-10-30 11:53:03','2021-04-23 20:24:09'),('1189390295668469762','李刚','高级讲师简介','高级讲师',2,'https://online-teach-file.oss-cn-beijing.aliyuncs.com/teacher/2019/10/30/b8aa36a2-db50-4eca-a6e3-cc6e608355e0.png',2,0,'2019-10-30 11:55:19','2019-11-12 13:37:52'),('1189426437876985857','李飞飞','李飞飞，女，1976年出生于中国北京，美国国家工程院院士，美国国家医学院院士，美国斯坦福大学首位红杉讲席教授 [9]  ，以人为本人工智能研究院（HAI）院长，AI4ALL联合创始人及主席，Twitter公司董事会独立董事','美国国家工程院院士、斯坦福大学教授',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210416/c9c14121-82f7-460e-a03c-51a0ea0a2c11file.png',0,0,'2019-10-30 14:18:56','2021-04-23 20:23:18'),('1189426464967995393','吴志健','吴志健 博士，武汉大学计算机学院教授，博士生导师。软件工程国家重点实验室副主任，中共党员。1983年于江西大学(现南昌大学)数学系获理学学士学位，1988年于武汉大学数学系获理学硕士学位，2004年于武汉大学计算机学院获工学博士学位。1988年至今在武汉大学软件工程国家重点实验室从事科研工作，主持或参与国家自然科学基金、“863”计划等各类科研项目20余项，发表论文70余篇。多次赴美国、澳大利亚、加拿大、香港访问研究','武汉大学计算机学院教授',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210416/2967a9e2-25ac-4a97-a77b-f9fca3d2ef55file.png',0,0,'2019-10-30 14:19:02','2021-04-23 20:22:41'),('1192249914833055746','李仲荣','李仲荣，1931年出生，辽宁省辽阳县人，计算机科学家、教授。','计算机科学家、教授',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210423/3a92ccce-2d56-4905-b36e-e9414ffbb506file.png',0,0,'2019-11-07 09:18:25','2021-04-23 20:22:16'),('1381165080627933185','陈元刚 ','陈元刚，男，1968年生，四川人，经济学教授，硕士研究生导师，社会保障系主任。现为“重庆市高校中青年骨干教师”，重庆市巴南区学术和技术带头人，重庆市《资本论》与社会主义市场经济研究会常务理事，西南马克思主义经济学论坛学术委员。 2006年9月-2007年9月在中国人民大学参加“高等学校青年骨干教师国内访问学者”项目。','经济学教授',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210423/992e5141-2fbd-415a-8774-09ceeb812dd9file.png',3,0,'2021-04-11 16:39:51','2021-04-23 20:21:36'),('1381880292611506177','沈君山 ','沈君山（1932年8月29日-2018年9月12日），浙江余姚人，家世显赫，台湾大学物理系学士，美国马里兰大学物理博士，曾任职于普林斯顿大学，美国太空总署太空研究所及普度大学。 1973 年回台湾后，担任清华大学物理系教授兼理学院院长，后曾担任行院政务委员，并于1993 年当选第一届民选校长。\n','物理学教授',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210423/abc62916-d6c8-4f72-a582-37902bc1421ffile.png',6,0,'2021-04-13 16:01:51','2021-04-23 20:20:26'),('1384425555226619906','刘淑梅','男，生于1958年7月，北京大学数学科学学院教授、中国科学院院士。现任北京国际数学研究中心副主任、数学及其应用教育部重点实验室主任、北京数学会理事长。现为Asia-European J.Math和《数学学报》副主编，Communications in Algebra等5种重要期刊编委。主要从事代数学研究。在80年代早期对有限单群分类中心有突出贡献，且在世界上第一个给出了亏零P-块的充要条件。随后在当代模表示论的研究中作出多项重要贡献，对著名Puig猜想的研究为该理论的进一步发展开辟了道路，创立和系统发展了群的算术理论，进而解决了Huppert猜想和共轭类长猜想等长期未解决的难题，并在Zeta-函数和黎曼流形上的Laplace-Beltrami算子等研究领域得到应用。把代数K-理论应用到模表示论的研究中。','北大数学系教授、中国科学院院士',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210420/afde005f-8596-4c51-acf0-988b8111ba41file.png',1,0,'2021-04-20 16:35:48','2021-04-24 11:59:18'),('1386933131734441985','测试','22','111',1,'https://zut-mooc.oss-cn-beijing.aliyuncs.com/20210427/cc1d2538-86d1-4451-a63c-b2ab507f4e84file.png',1,1,'2021-04-27 14:40:01','2021-04-27 14:40:15'),('string','string','string','string',0,'string',0,1,'2021-06-02 13:08:05','2021-06-02 13:08:05');
/*!40000 ALTER TABLE `edu_teacher` ENABLE KEYS */;
